import base64
import os

import cv2
import numpy as np
from dotenv import load_dotenv
from ultralytics import YOLO

load_dotenv()


def train_container_detector(yolo_model_type: str, number_of_epochs: int):
    model = YOLO(yolo_model_type + '.yaml')
    model.train(data="yolo_config.yaml", epochs=number_of_epochs)


def identify_container_units(model_path: str, image: cv2.typing.MatLike, threshold: float):
    detection_model_used = os.path.join(os.path.dirname(os.path.abspath(__file__)),
                                        os.path.join('runs', 'detect', 'train3', 'weights', 'last.pt'))
    try:
        trained_model = YOLO(detection_model_used)
    except Exception as e:
        print(e)
        exit(0)
    results = trained_model(image)[0]
    container_positions = []
    for result in results.boxes.data.tolist():
        x1, y1, x2, y2, score, class_id = result
        # print(x1, y1, x2, y2, score, class_id)
        if score > threshold:
            if int(class_id) == 0:
                cv2.rectangle(image, (int(x1), int(y1)), (int(x2), int(y2)), (0, 0, 255), 4)
            elif int(class_id) == 1:
                cv2.rectangle(image, (int(x1), int(y1)), (int(x2), int(y2)), (255, 0, 0), 4)
            elif int(class_id) == 2:
                cv2.rectangle(image, (int(x1), int(y1)), (int(x2), int(y2)), (255, 255, 255), 4)
            elif int(class_id) == 3:
                cv2.rectangle(image, (int(x1), int(y1)), (int(x2), int(y2)), (0, 0, 0), 4)
            container_positions.append([(x1, y1), (x2, y2)])

    container_count = 1
    for left_upper_corner, right_lower_corner in container_positions:
        print(f'Container {container_count} Length:\n' +
              f'x axis: {abs(right_lower_corner[0] - left_upper_corner[0])}, '
              f'y axis: {abs(left_upper_corner[1] - right_lower_corner[1])}')
        container_count += 1

    x_sorted_array = sorted(container_positions, key=lambda x: x[0][0])
    print(x_sorted_array)
    y_sorted_array = sorted(container_positions, key=lambda x: x[1][1])
    print(y_sorted_array)

    cv2.imshow('Image with Objects', image)
    cv2.waitKey(0)
    cv2.destroyAllWindows()


